import pdfMake from "pdfmake/build/pdfmake";
import printjs from "print-js";
import * as pdfFonts from "./vfs_fonts";

pdfMake.vfs = pdfFonts.default;

const createPdf = (props, output = "print") =>
  new Promise((resolve, reject) => {
    try {
      const {
        pageSize = {
          width: 200,
          height: "auto",
        },
        pageMargins = [20, 40, 20, 40],
        info = {
          title: "F001-000001",
          author: "maclode",
          subject: "ticket",
          keywords: "tck, sale",
        },
        styles = {
          header: {
            fontSize: 14,
            bold: true,
            alignment: "center",
            margin: [0, 0, 0, 10],
          },
          subheader: {
            fontSize: 12,
            margin: [0, 0, 0, 5],
          },
        },
        images = {
          my: "data:image/jpeg;base64,",
        },
        content,
      } = props;

      const docDefinition = {
        pageSize,
        pageMargins,
        info,
        content,
        styles,
        images,
      };

      if (output === "b64") {
        const pdfMakeCreatePdf = pdfMake.createPdf(docDefinition);
        pdfMakeCreatePdf.getBase64((data) => {
          resolve({
            success: true,
            content: data,
            message: "Archivo generado correctamente.",
          });
        });
        return;
      }

      //  ENVIAR A IMPRESIN DIRECTA
      if (output === "print") {
        pdfMake.createPdf(docDefinition).download();
        // pdfMakeCreatePdf.getBase64((data) => {
        //   printjs({
        //     printable: data,
        //     type: "pdf",
        //     base64: true,
        //   });
        //   resolve({
        //     success: true,
        //     content: null,
        //     message: "Documento enviado a impresin.",
        //   });
        // });
        return;
      }

      reject(new Error("Debes enviar tipo salida"));
    } catch (error) {
      reject(new Error(error?.message ?? "No se pudo generar proceso."));
    }
  });

export default createPdf;
